import classes from './Footer.module.css';
import Container from 'react-bootstrap/esm/Container';
import Row from 'react-bootstrap/esm/Row';
import { Linkedin, Github, Link } from 'react-bootstrap-icons';
import Col from 'react-bootstrap/esm/Col';


const Footer = () => {
    return ( 
        <footer className={classes.footer}>
            <Container>
                <div className="icon-container">
                    <a href="https://www.linkedin.com/in/spencer-josi/?profileId=ACoAACkZ_98BNC_gIoF5rD-TR-OsiqpjZiLEvuo">
                        <Linkedin fill="white" size={32}/>
                    </a>
                    <a href="https://github.com/spenny-jay?tab=repositories">
                        <Github fill="white" size={32}/>
                    </a> 
                    <a href="https://drive.google.com/file/d/1EId-1Jpb84NYfn3wpH4pX8jKmVNcaq-P/view?usp=sharing">
                        <Link fill="white" size={32}/>
                    </a> 
                </div>
                <Row className="justify-content-center">
                    <span className={classes.footer__name}>Spencer Josi, 2023</span>
                </Row>
            </Container>
        </footer>
     );
}

export default Footer;
